  #vomnibar {
    display: block;
    position: fixed;
    width: calc(100% - 20px); /* adjusted to keep border radius and box-shadow visible*/
    /*min-width: 400px;
    top: 70px;
    left: 50%;*/
    top: 8px;
    left: 8px;
    /*margin: 0 0 0 -40%;*/
    font-family: Roboto;

    background: #2e3440;
    text-align: center;
    border-radius: 4px;
    border: none;
    z-index: 2139999999; /* One less than hint markers and the help dialog (see ../content_scripts/vimium.css). */
  }

  #vomnibar input {
    color: #eceff4;
    font-family: 'Open Sans', Helvetica Neue, Arial, sans-serif;
    font-size: 28px;
    height: 44px;
    margin-bottom: 0;
    padding: 4px;
    background-color: #2e3440;
    border-radius: 3px;
    border: none;
    width: 100%;
    outline: none;
    box-sizing: border-box;
  }

  #vomnibar .vomnibarSearchArea {
    display: block;
    padding: 10px;
    background-color: #2e3440;
    border-radius: 4px 4px 0 0;
    border-bottom: none;
  }

  #vomnibar ul {
    background-color: #2e3440;
    border-radius: 0 0 4px 4px;
    list-style: none;
    padding: 10px 0;
    padding-top: 0;
  }

  #vomnibar li {
    border-bottom: none;
    line-height: 1.1em;
    padding: 7px 10px;
    font-size: 16px;
    color: #eceff4;
    position: relative;
    display: list-item;
    margin: auto;
  }

  #vomnibar li:last-of-type {
    border-bottom: none;
  }

  #vomnibar li .vomnibarTopHalf, #vomnibar li .vomnibarBottomHalf {
    display: block;
    overflow: hidden;
  }

  #vomnibar li .vomnibarBottomHalf {
    font-size: 15px;
    margin-top: 3px;
    padding: 2px 0;
  }

  #vomnibar li .vomnibarIcon {
    background-position-y: center;
    background-size: 16px;
    background-repeat: no-repeat;
    padding-left: 20px;
  }

  #vomnibar li .vomnibarSource {
    color: #eceff4;
    margin-right: 4px;
  }
  #vomnibar li .vomnibarRelevancy {
    position: absolute;
    right: 0;
    top: 0;
    padding: 5px;
    background-color: #2e3440;
    color: #eceff4;
    font-family: monospace;
    width: 100px;
    overflow: hidden;
  }

  #vomnibar li .vomnibarUrl {
    white-space: nowrap;
    color: #b48ead;
  }

  #vomnibar li .vomnibarMatch {
    font-weight: bold;
    color: #81a1c1;
  }

  #vomnibar li em, #vomnibar li .vomnibarTitle {
    color: #eceff4;
    margin-left: 4px;
    font-weight: normal;
  }
  #vomnibar li em { font-style: italic; }
  #vomnibar li em .vomnibarMatch, #vomnibar li .vomnibarTitle .vomnibarMatch {
    color: #eceff4;
  }

  #vomnibar li.vomnibarSelected {
    background-color: #8fbcbb;
    font-weight: normal;
  }

  #vomnibarInput::selection {
    background-color: #8fbcbb;
  }

  .vomnibarInsertText {
  }

  .vomnibarNoInsertText {
    visibility: hidden;
  }
